import styled from "styled-components";

const Foot = styled.div`
	background-color: ${(props) => props.color};
	padding: 25px 30px;
	position: fixed;
	left: 0%;
	width: 100%;
	bottom: 0;
`;

const Footer = () => {
	return (
		<>
			<Foot color="lightblue">Footer</Foot>
		</>
	);
};
export default Footer;
